window.bookSummaryJSON = "<p>The Quint is bound. The Black Knight is exposed. The final battle has begun.</p> <p>With my mates and I bonded in body and soul, the Quint is fully aligned. And while it feels sometimes like it's the five of us against the world, it's not. Along the way, we've built family and friends and allies invested in our success. They stand behind us as we tackle our final trials. Our time of being on the defensive is over... it's offense now. Our destiny... Open a portal to StoneHaven. Unite the realms. Live happily ever after. With our lives on the line, the five of us dig in. We fought hard for the future that's within our grasp and no one will take that away from us. </p> <p>*This is book five in a steamy reverse harem paranormal romance series. Expect sexy polyamorous situations (mmmfm), rollicking action, ongoing storylines, and shifter lovers who find what they need from not only their queen but each other as well. Med-burn, med angst, vivid sexual content, and language.*</p>"; 
